# 项目群统计分析

Cloud Native预置多种常用项目群报表，支持从工作交付、质量两方面生成各类报表，用于日常和回顾统计分析，使团队成员随时了解当前项目群进展情况，及时发现并解决问题。

项目群的报表统计项目群所属子项目的数据。因此，当完成迭代规划后，您才能利用报表进行统计分析。如果还未创建迭代，则统计分析界面显示为空，并提示创建迭代计划。

Cloud Native提供2组共5类项目群统计报表模板，您也可以根据实际情况选择模板，创建报表。
<style>
table th:first-of-type {
    width: 20%;
}
table th:nth-of-type(2) {
    width: 20%;
}
table th:nth-of-type(3) {
    width: 60%;
}
</style>

|报表分组    |报表类型 |说明 |
| :--------- | :-------- | :----- |
|敏捷交付|需求年龄图|展示需求（Epic/Feature/Story）从创建到关闭的时间在不同时间段上的分布情况。|
|敏捷交付|工作项分布图|展示工作项数量在不同维度的分布情况。|
| 质量内建    |缺陷分布图 |展示所有子项目的缺陷在不同维度的分布。|
| 质量内建    |缺陷趋势图|展示各项目的缺陷数量在时间上的走势变化。|
|质量内建|缺陷年龄图|展示缺陷从创建到关闭的时间在不同时间端上的分布情况。|

